import React from "react";

const NoteItems = (props) => {
  const { note } = props;
  return (
    <>
    <h1>Your Notes</h1>
    <div className="col-md-3">
      <div class="row my-3 card">
        <div class="card-body">
          <h5 class="card-title">{note.title}</h5>
          <p class="card-text">{note.description}</p>
        </div>
      </div>
    </div>
    </>
  );
};

export default NoteItems;
